import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Table from 'react-bootstrap/Table';
import { useNavigate } from 'react-router-dom'
 

const Other = () => {

    const navigate = useNavigate()
    const sessionToken = sessionStorage.getItem("loggedIn");
    const [data, setData] = useState({});

    useEffect(() => {
        if(!sessionToken)
        {
            navigate('/login');
        }
        const getData = async () => {
                    // const {data: res} = await axios.get(TICKET_URL)
                    // setData(res);
                
        }
        getData();
    }, [])
    
    return(
        <>
            {sessionToken &&
            <div className='container d-flex justify-content-center'>
                <div className="card text-center">
                    <div className="card-header">
                        Admin
                    </div>
                    <div className='card-body'>
                        <Table striped bordered>
                            <thead>
                                <tr>
                                <th>ID</th>
                                <th>Name,Lastname</th>
                                <th>Quantity</th>
                                <th>Payment</th>
                                <th>Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                    <td>ASDDR88</td>
                                    <td>Rokas Saudargis</td>
                                    <td>100</td>
                                    <td>internetu</td>
                                    <td><button className='btn btn-primary'>Patvirtinti</button><button className='btn btn-primary'>Atšaukti</button></td>
                                </tr>
                                <tr>
                                    <td>ASDDR88</td>
                                    <td>Rokas Saudargis</td>
                                    <td>100</td>
                                    <td>internetu</td>
                                    <td><button className='btn btn-primary'>Patvirtinti</button><button className='btn btn-primary'>Atšaukti</button></td>
                                </tr>
                                <tr>
                                    <td>ASDDR88</td>
                                    <td>Rokas Saudargis</td>
                                    <td>100</td>
                                    <td>internetu</td>
                                    <td><button className='btn btn-primary'>Patvirtinti</button><button className='btn btn-primary'>Atšaukti</button></td>
                                </tr>
                            </tbody>
                        </Table>
                    </div>
                </div>
            </div>
            }
        </>
    )
}

export default Other;
